const reducer = (state = {}, action) => {
    switch (action.type) {
      case 'SET_DATA_LOGIN':
        console.log('action', action)
        switch(action.id) {
          case "user-name":
            return { ...state, userName: action.data };
            break;
          case "pass-word":
            return { ...state, password: action.data };
            break;
        }
      default: 
        return state;
    }
   };
   export default reducer;
